import React from 'react'
import SignUp from '../components/authentication/SignUp'

const Login = () => {
  return (
    <main className='py-16'>
        <div className='p-6 rounded-[12px] bg-white shadow-[0px_0px_20px_0px_rgba(0,0,0,0.10)] w-full max-w-[460px] mx-auto'>
          <SignUp />
      </div>
    </main>
  )
}

export default Login
